(26, 'Boneless Dada Kulit', 3, 'fresh', 'pack', 1, NULL, 43000, 0, 42000, 'images/product-2019-09-24-130318.jpg', NULL, 'Kenalan Yuk!\r\n\r\nBoneless dada kulit ini merupakan dada ayam tanpa tulang dengan kulit, sudah bersih, siap masak! Disediakan khusus untuk kamu yang mau masak ayam geprek dan Fried Chicken ala Taiwan. \r\n\r\nSemua ayam fresh yang dipotong di malam hari lalu dikirim keesokan harinya. Dilengkapi dengan sertifikasi Halal dan NKV, Boneless dada kulit ini terbebas dari virus flu burung, higienis, serta melalui proses pemotongan yang modern dan terbebas dari zat berbahaya.', '1', NULL),
(27, 'Boneless Dada Tanpa Kulit (Butterfly)', 3, 'fresh', 'pack', 1, NULL, 43000, 0, 42000, 'images/product-2019-09-26-100319.jpg', NULL, 'Kenalan Yuk!\r\n\r\nBoneless dada tanpa kulit merupakan dada ayam tanpa tulang dan kulit berbentuk butterfly, sudah bersih, siap masak! Disediakan khusus untuk kamu yang mau masak ayam geprek dan Fried Chicken ala Taiwan. \r\n\r\nSemua ayam fresh yang dipotong di malam hari lalu dikirim keesokan harinya. Dilengkapi dengan sertifikasi Halal dan NKV, Boneless dada tanpa kulit ini terbebas dari virus flu burung, higienis, serta melalui proses pemotongan yang modern dan terbebas dari zat berbahaya.', '1', NULL),
(28, 'Boneless Dada Single', 3, 'fresh', 'pack', 1, NULL, 43000, 0, 42000, 'images/product-2019-09-26-105720.jpg', NULL, 'Kenalan Yuk!\r\n\r\nBoneless dada single merupakan dada ayam tanpa tulang dan kulit Butterfly yang sudah dibelah 2, sudah bersih, siap masak! Disediakan khusus untuk kamu yang mau masak ayam geprek dan Fried Chicken ala Taiwan. \r\n\r\nSemua ayam fresh yang dipotong di malam hari lalu dikirim keesokan harinya. Dilengkapi dengan sertifikasi Halal dan NKV, Boneless dada single ini terbebas dari virus flu burung, higienis, serta melalui proses pemotongan yang modern dan terbebas dari zat berbahaya.', '1', NULL),
(29, 'Fillet (Tenderloin Ayam)', 3, 'fresh', 'pack', 1, NULL, 38000, 0, 37000, 'images/product-2019-09-26-105022.jpg', '1', 'Kenalan Yuk!\r\n\r\nFillet ayam ini merupakan bagian dalam dari boneless dada atau biasa disebut khas dalam dada ayam atau tenderloin ayam. Fillet ayam memiliki tekstur yang sangat lembut, sudah bersih, siap masak! Disediakan khusus untuk kamu yang mau masak ayam geprek dan Fried Chicken ala Taiwan. Berani coba lembutnya? \r\nSemua ayam fresh yang dipotong di malam hari lalu dikirim keesokan harinya. Dilengkapi dengan sertifikasi Halal dan NKV, Fillet ayam ini terbebas dari virus flu burung, higienis, serta melalui proses pemotongan yang modern dan terbebas dari zat berbahaya.', '1', NULL),
(30, 'Boneless Paha Kulit', 3, 'fresh', 'pack', 1, NULL, 44000, 0, 43000, 'images/product-2019-09-26-111016.jpg', NULL, 'Kenalan Yuk!\r\n\r\nBoneless paha dengan kulit atau Paha ayam tanpa tulang masih ada kulit sudah bersih, siap masak! disediakan khusus untuk kamu yang mau masak ayam geprek dan Fried Chicken ala Taiwan dilengkapi gurihnya kulit ayam. \r\nSemua ayam fresh yang dipotong di malam hari lalu dikirim keesokan harinya. Dilengkapi dengan sertifikasi Halal dan NKV, boneless paha dengan kulit ini terbebas dari virus flu burung, higienis, serta melalui proses pemotongan yang modern dan terbebas dari zat berbahaya.', '1', NULL),
(31, 'Boneless Paha Tanpa Kulit', 3, 'fresh', 'pack', 1, NULL, 44000, 0, 43000, 'images/product-2019-09-26-121315.jpg', NULL, 'Kenalan Yuk!\r\n\r\nBoneless paha tanpa kulit atau Paha ayam tanpa tulang dan kulit sudah bersih, siap masak! disediakan khusus untuk kamu yang mau masak ayam geprek dan Fried Chicken ala Taiwan. \r\nSemua ayam fresh yang dipotong di malam hari lalu dikirim keesokan harinya. Dilengkapi dengan sertifikasi Halal dan NKV, boneless paha tanpa kulit ini terbebas dari virus flu burung, higienis, serta melalui proses pemotongan yang modern dan terbebas dari zat berbahaya.', '1', NULL),
(32, 'Sayap', 8, 'fresh', 'kg', 1, NULL, 30500, NULL, 29500, 'images/product-2019-08-22-140809.jpg', NULL, 'Kenalan Yuk!\r\n\r\nSayap Ayam dari Meyer Food disediakan khusus untuk kamu wings lovers! Aah. \r\nSemua sayap ayam fresh yang dipotong di malam hari dan dikirim keesokan harinya. Dilengkapi dengan sertifikasi Halal dan NKV, sayap ayam ini terbebas dari virus flu burung, higienis, serta melalui proses pemotongan yang modern dan terbebas dari zat berbahaya.', '1', NULL),
(33, 'Ceker', 7, 'fresh', 'kg', 1, NULL, 24000, 0, 23000, 'images/product-2019-08-22-140916.jpg', NULL, 'Kenalan Yuk!\r\n\r\n1 kg Ceker ayam berisikan sampai 30 pcs. Ceker ayam dari Meyer Food disediakan khusus untuk kamu pecinta ceker! Semua ceker ayam fresh yang dipotong di malam hari lalu dikirim keesokan harinya. Dilengkapi dengan sertifikasi Halal dan NKV. Ceker Ayam sangat bagus untuk dikonsumsi karena memiliki kandungan Hydroxyapatite dan Protein Kolagen yang berfungsi untuk menjaga tulang yang kuat serta menjaga imunitas tubuh.', '1', NULL),
(34, 'Hati Ampela Bersih', 7, 'fresh', 'pack', 1, NULL, 22000, 0, 21000, 'images/product-2019-08-22-140843.jpg', NULL, 'Kenalan Yuk!\r\n\r\nHati Ampela Bersih berisi campuran hati dan ampela siap masak. Berat Bersih 1 kg.\r\nYang harus kita ketahui ternyata Hati Ampela memiliki banyak zat penting seperti protein, vitamin B2, vitamin B3, vitamin A, vitamin B12, serta berbagai jenis mineral seperti seng, magnesium dan zin. Hati ampela juga merupakan sumber terbaik untuk mengatasi tubuh yang terasa lelah.', '1', NULL),
(35, 'Hati Bersih', 7, 'fresh', 'kg', 1, NULL, 20000, 0, 19000, 'images/product-2019-09-26-113855.jpg', NULL, 'Yuk Kenalan!\r\n\r\nHati ayam bersih dengan berat 1 kg berisi 20 pcs. Siap pakai untuk masak.\r\nHati ayam itu sendiri memiliki sumber nutrisi yang penting untuk tubuh seperti vitamin A, vitamin B-12, mineral dan asam folat oleh karena itu hati ayam layak untuk dikonsumsi sehari-hari.', '1', NULL),
(36, 'Krongkong', 7, 'fresh', 'pack', 1, NULL, 0, 0, -1000, 'images/product-2019-05-20-092939.png', NULL, 'Daging ayam segar berkualitas cocok untuk pasokan ke rumah sakit, hotel ataupun restoran dan cafe yang selalu menyediakan menu masakan dari daging ayam. Bagi anda yang membutuhkan suplai daging ayam segar segera hubung kami atau cek harga ayam terbaru untuk melihat update harga ayam sekarang. Bagi anda yan ingin bekerjasama atau mempunyai bisnis supllier daging ayam, jangan ragu hubungi kami.', '0', NULL),
(37, 'Kepala', 7, 'fresh', 'pack', 1, NULL, 13000, 0, 12000, 'images/product-2019-08-22-150316.jpg', NULL, 'Kenalan Yuk!\r\n\r\nKepala Ayam dengan berat bersih 1 kg berisi sekitar 10 pcs, siap masak. Sangat cocok untuk dimasak bumbu kuning, bacem ketumbar.', '1', NULL),
(38, 'Dada Utuh', 3, 'fresh', 'pack', 1, NULL, 39500, 0, 38500, 'images/product-2019-08-22-134842.jpg', NULL, 'Yuk Kenalan!\r\n\r\nDada utuh dengan berat bersih kurang lebih 1 kg masih dengan tulang.\r\nPerlu diketahui nih dada ayam ternyata memiliki banyak kandungan protein yang tinggi dan menjadi serat makanan yang baik untuk tubuh. Jadi tidak ada salahnya punya banyak stok daging ayam dirumah ya. Cara ideal untuk mendapatkan manfaat maksimal dari daging ayam adalah dengan cara memanggangnya atau bisa pula dengan cara membakarnya.', '1', NULL),
(39, 'Paha Atas', 5, 'fresh', 'pack', 1, NULL, 39500, 0, 38500, 'images/product-2019-09-26-114308.jpg', NULL, 'Kenalan Yuk!\r\n\r\nPaha Atas fresh siap masak, khusus untuk kamu pecinta paha Atas. Berat bersih 1 kg dengan isi 8-9 pcs potong paha atas.', '1', NULL),
(40, 'Paha Bawah', 5, 'fresh', 'pack', 1, NULL, 39500, 0, 38500, 'images/product-2019-09-05-111806.PNG', NULL, 'Kenalan Yuk!\r\n\r\nProduk ini cocok untuk kamu pecinta paha bawah. Berat bersih 1 kg dengan isi 11-12 potong paha bawah. Rasanya yang lembut  cocok untuk dimasak ayam goreng tepung, ayam bakar, ayam bumbu Bali, dan lain-lain', '1', NULL),
(41, 'Sosis', 9, 'fresh', 'pack', 0.8, NULL, 0, 0, -1000, 'images/product-2019-05-20-093516.jpeg', '0', 'Daging ayam segar berkualitas cocok untuk pasokan ke rumah sakit, hotel ataupun restoran dan cafe yang selalu menyediakan menu masakan dari daging ayam. Bagi anda yang membutuhkan suplai daging ayam segar segera hubung kami atau cek harga ayam terbaru untuk melihat update harga ayam sekarang. Bagi anda yan ingin bekerjasama atau mempunyai bisnis supllier daging ayam, jangan ragu hubungi kami.', '0', NULL),
(42, 'Kornet', 9, 'fresh', 'pack', 0.8, NULL, 0, 0, -1000, 'images/product-2019-05-20-093609.jpg', '0', 'Daging ayam segar berkualitas cocok untuk pasokan ke rumah sakit, hotel ataupun restoran dan cafe yang selalu menyediakan menu masakan dari daging ayam. Bagi anda yang membutuhkan suplai daging ayam segar segera hubung kami atau cek harga ayam terbaru untuk melihat update harga ayam sekarang. Bagi anda yan ingin bekerjasama atau mempunyai bisnis supllier daging ayam, jangan ragu hubungi kami.', '0', NULL),
(43, 'Bakso', 9, 'fresh', 'pack', 0.8, NULL, 0, 0, -1000, 'images/product-2019-05-20-093738.jpg', '0', 'Daging ayam segar berkualitas cocok untuk pasokan ke rumah sakit, hotel ataupun restoran dan cafe yang selalu menyediakan menu masakan dari daging ayam. Bagi anda yang membutuhkan suplai daging ayam segar segera hubung kami atau cek harga ayam terbaru untuk melihat update harga ayam sekarang. Bagi anda yan ingin bekerjasama atau mempunyai bisnis supllier daging ayam, jangan ragu hubungi kami.', '0', NULL),
(44, 'Ayam Bumbu', 9, 'fresh', 'pack', 0.8, NULL, 0, 0, -1000, 'images/product-2019-05-20-093923.jpg', '0', 'Kenalan yuk!\r\n\r\nAyam bumbu ini diciptakan untuk kamu yang mau makan ayam goreng enak ga pake repot. Ayam yang sudah dimarinasi dengan racikan 18 bumbu dapur alami dari Meyer Food. Rasanya dijamin membawa kebahagiaan di hati.', '0', NULL),
(45, 'Spicy Wings', 9, 'fresh', 'pack', 0.8, NULL, 0, 0, -1000, 'images/product-2019-05-20-094037.jpg', '0', 'Daging ayam segar berkualitas cocok untuk pasokan ke rumah sakit, hotel ataupun restoran dan cafe yang selalu menyediakan menu masakan dari daging ayam. Bagi anda yang membutuhkan suplai daging ayam segar segera hubung kami.', '0', NULL),
(46, 'HOT PROMO 2 Ekor Uk 0.8-0.9 kg', 1, 'fresh', 'pack', 0.8, NULL, 50000, 0, 49000, 'images/product-2019-09-26-111623.jpg', '1', 'HOT PROMO\r\n\r\nAyam Utuh (karkas) dengan berat bersih 0.8-0.9 kg\r\n2 Ekor hanya Rp 50.000,00.\r\nBuat kamu para pecinta makanan tinggi protein ini beruntung banget, karena dibalik rasa lezatnya ayam ternyata memiliki banyak manfaat untuk kesehatan seperti dapat menurunkan risiko tubuh terkena penyakit jantung dan menjaga kesehatan sel-sel tubuh. tak hanya itu, ayam juga mengandung B6 yang membantu meningkatkan proses metabolisme dan menstimulasi sistem kekebalan tubuh. Siap untuk dimasak dibuat soup dll.', '1', NULL),
(47, 'HOT PROMO 2 Ekor Uk 0.8-0.9 kg Pot 8', 2, 'fresh', 'pack', 0.8, NULL, 50000, 0, 49000, 'images/product-2019-08-27-111244.jpeg', '1', 'HOT PROMO\r\n\r\nAyam dengan berat bersih 0.8-0.9 kg dipotong 8 bagian. 2 Ekor hanya Rp 50,000.\r\nSedikit informasi aja nih, kalau ayam bukan hanya memiliki sumber protein saja, tetapi juga memiliki sumber vitamin dan mineral yang sangat baik juga. Vitamin dan mineral yang ditemukan pada ayam sangat banyak dan berguna untuk berbagai proses dalam tubuh kita. Misalnya, Vit B, Vit D, Vit A, Kalium dan Natrium.', '1', NULL),
(48, 'HOT PROMO 2 Ekor Uk 0.8-0.9 kg Pot 4', 2, 'fresh', 'pack', 0.8, NULL, 50000, NULL, 49000, 'images/product-2019-09-04-124959.JPG', '1', 'HOT PROMO 2 ekor ayam dengan ukuran 0.8-0.9 kg pot 4 hanya 50.000.\r\nSedikit informasi aja nih, kalau ayam bukan hanya memiliki sumber protein saja, tetapi juga memiliki sumber vitamin dan mineral yang sangat baik juga. Vitamin dan mineral yang ditemukan pada ayam sangat banyak dan berguna untuk berbagai proses dalam tubuh kita. Misalnya, Vit B, Vit D, Vit A, Kalium dan Natrium.\r\nSiap untuk dimasak bisa dipanggang ataupun dibakar, sangat cocok juga untuk dijadikan bahan membuat soup dirumah.', '1', NULL),
(49, 'Karkas Ukuran 1.2-1.3 kg', 1, 'frozen', 'pack', 1.2, NULL, 30000, NULL, 29000, 'images/product-2019-09-26-111536.jpg', '1', 'Kenalan Yuk!\r\n\r\nAyam Karkas Ukuran 1.2-1.3 kg utuh, siap masak.\r\nSedikit informasi aja nih, kalau ayam bukan hanya memiliki sumber protein yang sangat baik, tetapi juga memiliki sumber vitamin dan mineral yang sangat baik juga. Vitamin dan mineral yang ditemukan pada ayam sangat banyak dan berguna untuk berbagai proses dalam tubuh kita. Misalnya, Vit B, Vit D, Vit A, Kalium dan Natrium.', '1', NULL),
(50, 'Karkas Ukuran 1.3-1.4 kg', 1, 'fresh', 'pack', 1.3, NULL, 38000, NULL, 37000, 'images/product-2019-09-26-111505.jpg', NULL, NULL, '1', NULL),
(51, 'Karkas Ukuran 1.4-1.5 kg', 1, 'fresh', 'pack', 1.4, NULL, 41000, NULL, 40000, 'images/product-2019-09-26-111431.jpg', NULL, 'Kenalan Yuk! \r\nAyam Karkas Ukuran 1.4-1.5 kg utuh, siap masak. Manfaat makan daging ayam bagi kesehatan jelas sangat tinggi, karena daging ayam mengandung protein tinggi, serta vitamin dan mineral.', '1', NULL),
(52, 'Paha Utuh (Paha Atas dan Bawah)', 5, 'fresh', 'pack', 1, NULL, 39500, NULL, 38500, 'images/product-2019-09-26-101443.jpg', NULL, 'Yuk Kenalan!\r\n\r\nPaha Utuh adalah campuran dari paha atas dan paha bawah. Ukuran all size dengan berat bersih 1 kg. Dalam 1 kemasan terdapat kurang lebih 5-7 potong campuran paha atas dan paha bawah.', '1', NULL),
(53, 'Ampela Bersih', 7, 'fresh', 'pack', 1, NULL, 22000, NULL, 21000, 'images/product-2019-09-05-153944.PNG', NULL, 'Kenalan Yuk!\r\n\r\nAmpela bersih siap masak dengan berat bersih 1 kg berisi 40 pcs. Ampela sangat baik untuk dikonsumsi karena memiliki 4 kandungan nutrisi yaitu rendah lemak & sodium, kaya akan zat besi serta mengandung vitamin B3 dan vitamin B2.', '1', NULL),
(54, 'Karkas Ukuran 1.0-1.1 kg pot 8', 2, 'fresh', 'pack', 1, NULL, 32500, 33000, 31500, 'images/product-2019-09-09-134029.jpeg', NULL, 'Kenalan yuk ..\r\n\r\nAyam Karkas Uk 1.0-1.1 kg pot 8.\r\nManfaat makan daging ayam bagi kesehatan jelas sangat tinggi loh buat kita, karena daging ayam mengandung protein tinggi, serta vitamin dan mineral. Makan daging ayam juga diyakini dapat membantu menurunkan berat badan, mengontrol kadar kolesterol, tekanan darah serta mengurangi resiko kanker.', '1', NULL),
(55, 'Ayam Pejantan Frozen (Dengan Kepala dan Ceker) 0,7-0,8 kg', 6, 'frozen', 'pack', 0.7, NULL, 37000, NULL, 36000, 'images/product-2019-09-12-100502.png', NULL, 'Ayam Pejantan Frozen (Dengan kepala dan ceker) ukuran 0.7-0.8 kg.\r\nBuat kalian para pecinta ayam sangat bagus loh, karena ayam kaya akan nutrisi, memiliki protein yang tinggi dan mengandung banyak vitamin didalamnya. Dibalik rasa lezatnya ayam ternyata juga memiliki banyak manfaat untuk kesehatan, misalnya menurunkan resiko tubuh terkena jantung, menjaga kesehatan gigi dan tulang, meningkatkan sistem kekebalan tubuh, serta menjaga ketajaman mata.', '1', NULL),
